    data: |
      SELECT - + 29, ( - col0 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 + - + col2 - - 74 + + col2 * - col1 - + - col0 > - col2 * 85 / col0 / + - col0;
  - name: tab1

outputs:
  - name: q11525.out
    data: |
